                         reviewText:
                              "This was a frustrating experience. The room is lovely and the service is professional and friendly but the food left me wondering‚Ä¶.why?\n\nI‚Äôll start with the Pho, you would expect this dish to be amazing, it should be amazing, but it was bland, bland, bland and very disappointing.\n\nWe went heavy on the starters and got the same dipping sauce and garnish on most dishes, I know there are many sauces to have in Vietnam therefore I would have expected to experience some of these.\n\nThe pork ribs as a main dish were amazing!\n\nLet‚Äôs talk about ‚Äúvalue add‚Äù experiences and how much the customer enjoys them. A small amuse bouche prior to receiving your ordered items is a must along with a small sweet at the end, not a dessert, just a small one bite taste. This venue would benefit from this sort of service. A restaurant that is placing itself in the upper end of the market should be offering this sort of service.\n\nGo and check it out, the food is good, but it doesn‚Äôt quite hit the spot that you might expect.",
