                         reviewerName: "Carlos Galvez",
                         reviewText:
                              "Vietnam House, owned by the celebrated Chef Luke Nguyen, is more than just a restaurant; it's a culinary voyage through Vietnam. Housed in a beautiful French Colonial building, the ambience is elegant with a touch of modern sophistication.\n\nThe menu, meticulously crafted by Chef Nguyen, boasts a delightful array of traditional Vietnamese dishes with a modern twist.  Expect to find all the classics you love, like ph·ªü and b√°nh m√¨, alongside innovative creations that burst with fresh, local flavors.  I was particularly impressed by Rice Noodles with Grilled Iberico Pork & Lobster Netted Spring Rolls.\n\nNo Vietnamese dining experience is complete without refreshing cocktails and decadent desserts. Vietnam House delivers on both fronts. Their beverage list features innovative takes on classic cocktails, incorporating unique Vietnamese ingredients.  And don't forget to save room for dessert - their options are as delicious as they are beautiful.\n\nWhile the price point leans towards fine dining, the quality of the ingredients, the expertise of the chef, and the overall ambiance make Vietnam House a worthwhile splurge.  The attentive service adds another layer of refinement to the experience and the cocktails were delicious. We only wish we'd had a chance to meet him!",
