                              "Based on my personal experience, I cannot strongly recommend this restaurant. Although I had initially secured an indoor table through the online booking system, the manager, Tina, persuaded me to switch to outdoor seating in the late afternoon with some excuse. Unfortunately, this is where the experience took a turn for the worse.\nDO NOT RISK YOURSELF AND SIT OUTDOOR!\nThe outdoor atmosphere was appealing but my enjoyable meal was unfortunately interrupted by unpleasant second hand smoke in the middle of the main course. For non-smokers, the indoor seating will be a safer choice.\nLet us go back to food. Overall, the food ranged from good to great. Lacking some mind blowing factor to make me wow. The amuse bouches were either good or normal. The prawn ravioli was excellent/great with its sauce. The Hokkaido scallop tasted fantastic/great with top-notch quality. The tenderloin was a bit disappointing and still good: the foie gras had a superb texture but a slightly fishy aroma, while the tenderloin itself met expectations. The cheese was average, with nothing particularly noteworthy. However, the apple tartare was exceptional: crispy and aromatic.\nThe service was initially attentive, but it became inconsistent as the restaurant filled with more guests. Unfortunately, the wait for my cheese after the tenderloin was unacceptable. Despite requesting it twice, I waited over 35 minutes, which falls short of the standards expected for a fine dining establishment.\nMy ratings tells everything and hope it helps.",
