                         time: "2024-05-26T07:03:03.000Z",
                         reviewerName: "Adam Arjuna",
                         reviewText:
                              "Restaurant that provides Vietnam Cuisines but with a very contemporary approach.\n\nAs long you come here with an open mind, you will enjoy your dining experience here as the ingredients used in their dish are very different than your traditional Vietnam that you usually imagine.\n\nThe concept was great and I do enjoy my experience here.\n\nThe passionfruit sauce was used for my prawn dish and it surprisingly goes well.\n\nThe chicken was slightly dry to my liking but the combination with the lemongrass stuffing was awesome.\n\nBest to enjoy your experience with a good of friends so that you can indulge more dishes and pay lesser after splitting your bill evenly.",
