                         time: "2021-10-30T07:24:19.000Z",
                         reviewerName: "Lee",
                         reviewText:
                              "Excellent experience at Laang today! The service was fast, attentive and friendly. The food quality was exceptional. We ordered the bun bo hue which had high quality beef, but a more mild taste in comparison to other local restaurants. We also ordered the mango salad with sea bass which was by far the star of the meal. The sea bass was cooked to perfection and the mango salad was juicy and flavorful. It also came with prawn crackers that complimented the juicyness of the salad well. For the other main, we ordered the banh mi \"dep chay\" which is a vegetarian mushroom sandwich. It was well cooked and had an amazing sauce on it. The bread was high quality baguette as well. The only thing I didn't like we're the french fries. I felt they were bland and lacked crispiness and seasoning. Finally we ordered the \"bo la lot chien\" which is beef wrapped in betel leaf then fried. It was tasty but different from what I was expecting having had bo la lot as street food before. All in all if you're looking for high quality, modern Vietnamese cuisine in a relaxed setting, come to Laang. You won't be disappointed. Also it is pet friendly, so you can bring your dog!",
