                         reviewText:
                              "It was a set menu event with 2 time slots, 5:30 and 8pm. We selected the 8pm one,  but had to wait and brought to our table at 8:50 (that table was empty since 8:25, and for some reason we were not sat down).  The whole point of a reservation is for the restaurant to HOLD the table for you.  Someone should learn the definition again.\n\nI have been there 2 times.  The first time was actually good.  This time is a collaboration with a Thai restaurant I think.  The foods was not worth the price. We have had better Thai food for less.  The ingredients used were very good,  but most things that came with the sauce was very salty. Did someone test taste the foods before they were served?  The slipper lobster was okay,  but the Wagyu beef was not edible, too salty.\n\nThe dessert was a weird idea. Fried shallot on top of a cake??? Maybe you wanted to do dried coconut flakes?\n\nOverall, an extremely disappointing experience this time, from the service to the food.  Quince is a high end restaurant,  but just any random small street food stall. I hope they can do better next time.",
