                         reviewerName: "Jason Hiak",
                         reviewText:
                              "Our inaugural dinner at Quince in Ho Chi Minh City was a delightful experience. The menu boasted an array of dishes, each presenting a unique and flavorful journey, full of 'wow' moments. The scallop pasta, at first glance, appeared ordinary but transformed into an exquisite taste sensation from the first spoonful. Similarly, the Hokkaido tomato dish delivered an unexpected and memorable burst of flavor. A standout was the duck, masterfully cooked over firewood, harmoniously blending the essences of traditional duck and roast pork.Dessert was an innovative take on the classic affogato ‚Äì encased in a crispy, fried crust, the ice cream lay atop a decadent chocolate coffee sauce, a must-try for aficionados of coffee and chocolate. The meal concluded with a thoughtful gesture: a complimentary box of assorted, subtly sweet candies, handcrafted by the chef, showcasing their culinary artistry.Quince, with its impeccable flavors and service, truly warrants its accolades, including the Michelin guide award. A must-visit for anyone looking for an extraordinary dining experience in Ho Chi Minh City.",
