                         reviewText:
                              "Hum is such a beautiful space, its interesting design and beautiful decor really make wonderful first impression. From the moment you step enter you feel like you're in for something special. The restaurant has multiple dining levels with each room offering its own unique ambience. We were seated on the higher dining level and the cool evening breeze brought me back to when I fell in love with Vietnam.\nFor me, coming to a higher end vegetarian restaurant the food must satisfy a number of senses, particularly sight and taste. I've eaten at some wonderful fine dining vegetarian restaurants in Vietnam and the visual aspect of the meals have always left me with a wow factor that's never been replicated anywhere else I've ever dined.\nUnfortunately Hum really dropped the ball.\nFor this expensive experience I really expected more, I really expected something that I'd really want to photograph and say to my friends, wow look at this.\nI was left indifferent to the foods taste and it's presentation, however most items I wanted to try were already sold out, so I'm sure there would have been a few gems tucked away there.\nThe overall, I'm unsure i'd like to try it again. I'm just not willing to risk it, particularly when there's so many amazing fine dining vegetarian options available in this wonderful city.",
