                         reviewerName: "Sanjay J Kamath",
                         reviewText:
                              "One of the highly rated Vegetarian and Health food cafes / restaurants in the city. We went here on a rainy day since the place was full and we got the outdoor seating area. One of the highlights of the place was the Hot Pot. We tried the mushroom Hot Pot and loved every bit of the experience trying it out. Quick service and nice staff. It was a bit expensive but overall it was worth the experience",
