                         reviewerName: "Left Handed Panzerfaust",
                         reviewText:
                              "A beautiful restaurant in a very convenient location. The host was very accommodating. I got caught out in heavy rain prior to entering and the host helped me dry out. The food was exceptional, well presented and very tasty. The drinks were creative and very refreshing.  The dessert was delightful.",
                         rating: 5,
                         rank: 3,
