                         time: "2023-12-12T03:42:33.000Z",
                         reviewerName: "Niklas Sahin",
                         reviewText:
                              "Hum is placed in a building that houses other restaurants and a very beautiful store. The entire place is extremely well designed and aesthetic. For the interior decor inspiration alone this place is worth a visit.\n\nThe food at Hum is terrific. Some of the food we had could have bolder flavour profiles in my personal opinion, all of it was extremely good though. And the dessert I had (black sesame rice balls) is to die for.",
                         rating: 5,
                         rank: 3,
