                         time: "2024-05-19T07:34:31.000Z",
                         reviewerName: "Paul Osswald",
                         reviewText:
                              "First of all, this restaurant is in a very interesting and cool building! It‚Äôs at least worth walking by for a look. We would definitely recommend going in for lunch or dinner though. There is a huge and very creative vegetarian menu and in our two visits tried as much as possible! Everything we tried was very good, especially the mushroom ‚Äústew‚Äù in a coconut, this was incredible. The passionfruit Hotpot was also very very good and had a great combination of flavors. We would recommend this restaurant to anyone visiting Ho Chi Minh City and looking for a good place to eat.",
                         rating: 5,
                         rank: 3,
