                         reviewerName: "Nadya Levina",
                         reviewText:
                              "We visited this fabulous restaurant and it absolutely exceeded my expectations. The atmosphere is lovely, complemented by unique decor and an inviting interior. The space cleverly includes both a veranda and an indoor area, catering to all preferences. The waitstaff were good, offering recommendations throughout our meal. The menu is diverse, featuring both unique dishes and a range of options for vegetarians and meat-eaters alike. While the prices are above average, even on the high side, the quality and experience definitely justify the cost.",
