                         time: "2023-12-30T15:00:17.000Z",
                         reviewerName: "Michelle Y",
                         reviewText:
                              "Superb restaurant with the most charming vibes. From the moment you enter the building, you're greeted with the friendliest smiles and warmest welcome. Even the menu book is a delight to browse through slowly. We love the steamed mushroom served in coconut, and the braised Palm of Heart claypot dish. Drinks are very delicious too, freshly brewed with clean ingredients. Can't wait to be back!",
                         rating: 5,
                         rank: 6,
