                         time: "2024-02-06T08:15:47.000Z",
                         reviewerName: "Simon",
                         reviewText:
                              "Hum is a special dining experience and the people behind this concept are masters of blending tranquil spaces and offering a dining experience that is refreshing, uplifting and satisfying. The service is detailed, yet laid back. Every table is greeted by a guest relations manager to make certain the service and food is up to satisfactory standards and to make small talk. The entire space is welcoming, clean and a nice break away from the bustle of the city. I would recommend this restaurant for romantic dinners, small gatherings of 6 or less people, tourists, health conscious persons and for people that like a little refinement that isn‚Äôt pretentious or stuffy.\n\nThe restaurant has had a successful run in its 11 year history and has recently expanded the concept to include a brand new neighboring space that is absolutely stunning! I feel it is worth a visit just to see the building. On the ground floor there is a gift shop which offers many tasteful gifts, specialty Vietnamese wines (passion fruit & apricot wines) and a broad range of artisan products.\nDo yourself a favor and come dine here‚Ä¶ even if you are a meat eater.",
