                         reviewerName: "Avijeet Sen",
                         reviewText:
                              "Visited in Jul 2023\n\nGood restaurant with an Asian fusion menu. There are 2 menus - a la carte and tasting. I was really impressed with the food quality and the presentation. The flavours were quite exquisite. I tried 3 starters (pork jowl with hiraki egg, bluefin tuna and foie gras, wild caught cobia with mustard leaf) and each of them were brilliant. For the mains, I ordered the duck, and the dish presentation was one of the best I‚Äôve ever seen - taste was fantastic too. Overall food wise, this is a 5/5 place.\n\nOnly reason for a 4 rating is that the service was a bit odd. When I sat down I was given a wine/drinks menu and then was never asked if I wanted any drinks. Also, I went in with the intention of trying the tasting menu, but was suggested to go for the a-la-carte menu when I mentioned my shellfish allergy. Then while ordering items from the a-la-carte menu, the restaurant was able to remove & replace certain ingredients from dishes to cater to my allergy - which left me confused as to why they could not have done it for the tasting menu.\n\nIn any case, this place is worth going to. Would be a definite recommendation for ppl visiting HCM.",
