                              "Beautiful spot and exquisite food!! Went for a special birthday dinner with set menu. Was beautifully presented and tasted incredible. Sat at the kitchen counter which was a great experience. Chef was very friendly and explained all dishes well and made us feel at home. Highly recommend for any foodies!!",
