                         time: "2023-07-10T09:32:39.000Z",
                         reviewerName: "Francis Acosta",
                         reviewText:
                              "While Esta‚Äôs food certainly did not lack flavor, given the different ingredients to create various tones in its dishes, I feel that it lacked harmony and thought some ingredients were randomly chosen to create a ‚Äúthematic‚Äù menu. Meanwhile, staff needs more training for the restaurant to deliver the premium it charges to its customers fully.\n\nLast weekend, my friends and I tried Esta‚Äôs summer-themed tasting menu. Of the eight dishes, I thought the beef tartare with plum gochujang and ox back marrow was good ‚Äì they all blended well together, creating an altogether new beef tartare dish not usually served elsewhere. The cold buckwheat noodle with summer vegetables was probably one of my favorites, as this hit the ‚Äúsummer theme‚Äù, given the sweet and fresh flavors the dish delivered.\n\nEverything else, however, was average. The pork jowl with abalone and hiraki egg felt forced, as the egg overpowered both the pork and abalone (which I didn‚Äôt taste much). I also felt that the quality of the pork was just average. Similarly, for the fried rice topped with Hokkaido sea urchin ‚Äì the sea urchin overpowered the fried rice (which I think was ok). The unicorn leatherjacket fish with curry leaves ‚Äì more of like cabbage with some fish, and the fish lacked flavor. The desserts were also disappointing. It tasted like the sweet, tart, and sour elements from the different ingredients were fighting against each other and not blending in harmony.\n\nMeanwhile, although the staff was attentive, it seemed as if they didn‚Äôt know what they were doing. They recommended a wine-tasting menu to go with the food menu but did not know exactly how much it was or which wines were included. We ended up ordering a bottle of white wine, but they served it not chilled. It also felt that they weren‚Äôt enthusiastic when explaining the dishes.\n\nOverall, Esta lacked the ‚ÄúYummm!‚Äù experience my friends and I would usually say from the looks, smell, and taste of the food. I guess the lack of the wow factor from the presentation of the food down to its smell was an indication of what was to come in terms of taste. At a lower price point, I would have rated this restaurant higher. But with its current prices, I believe the restaurant is overcharging its customers for the quality and experience it delivers. There is always room for improvement, though, as some of its dishes almost hit the mark (e.g., the duck, which is not on the tasting menu, is must try), and staff can continuously improve given the proper training.",
