                         reviewText:
                              "First time came to Ho Chi Minh City, one of our friend recommended us to try this place. Since we love trying new restaurants in different cities we booked it for our 2nd night during our trip.\n\nThe welcome was great. Super friendly staffs. When they show us the menu.\n\nWe just have a few comments - first, with regard to the service:\n\n1. We were recommended by our friend that we should share one tasting menu, as the staff recommended him and his partner to do that and just add from the a la carte menu to share. However, the staff there said that we cannot share, and insisted that we each have a tasting menu. We just did that and realized the tasting menu can actually be shared given the portion of the serving.\n\n2. The staff recommended us to do wine paring. When we asked how much it was, he said ‚Äújust a little‚Äù, though when we pressed him with the cost, apparently, it is the same cost as the tasting menu.\n\n3. We ended up ordering a bottle of white wine. What we wanted wasn‚Äôt available, which was fine, so ordered another bottle. However, when the wine arrived, it wasn‚Äôt even chilled when they served it.\n\n4. One of the dishes in the tasting menu - abalone, pork jole, hirake egg - the egg yolk was supposed to be intact as shown in the photo. However, they served the dish with the yolk broken and didn‚Äôt even bother to replate. They asked me if it was fine - I did not agree to this. What they did was to just replace the egg but did not plate it as it was originally intended.\n\n5. Music choice is very odd, it‚Äôs a fine dining restaurant but they are playing top pop hits. Which is a bit strange.\n\nOverall, the food are good but only 3 dishes out of 8 are unique. we just feel like the service wasn‚Äôt on point for the price that they charging as Michelin recommended list.",
