                         reviewText:
                              "Well what can we say about this little restaurant.  The food is amazing, the waitress called BLINK was so accommodating and friendly, she loved to talk to us to help her improve her English.\nThe atmosphere and music was great. We will definitely be back and would be happy to recommend this place to others.\n\nWe had to go back for a second day, because the food is just amazing and were served by Ari and Vinh.",
