                         reviewText:
                              "Everything was great, the food is excellent! My friend and I went there because I was looking for coffee and breakfast since I missed the breakfast buffet at our hotel. Sadly they ran out of coffee,\nbut good thing it was hot outside so we stayed. Boy, it was the best decision ever! Food was amazing, everything was great! Annie was our server and she was fantastic, we were given complimentary drinks and a gift bag too! The interior was sophisticated with the right touch of modern. It reminded me of the modern restaurants in Europe! Hopefully they get the full Michelin this year!",
