                         reviewText:
                              "Nice place to grab a meal. They have lunch sets at a decent price. Their old location seemed to be much more unique and portions were huge compared to now. The vibe now is similar to many other restaurants. Overall decent place to grab a bite!",
                         rating: 5,
                         rank: 7,
