                         time: "2024-08-01T05:44:49.000Z",
                         reviewerName: "Nnnn",
                         reviewText:
                              "The best resturant in Saigon by far. Starting with the food, we ordered beef empanadas, carne asada steak, and peri peri chicken. Not only was every dish prepared artistically, but the food itself was incredibly tasting. Every main course was served with either Mexican or coriander rice, and tortillas which added to the taste. pro tip: order the carne asada steak, wrap it in a tortilla with Mexican rice, drench it with chimichuri, and enjoy! Not to mention, the peri peri chicken was falling off the bone. The juiciness of the chicken left us utterly amazed.\n\nThe service was top notch, as expected from a Michelin recommended restaurant. Our waitress had heard me comment that I liked sour drinks, and as it was my birthday, she brought us a round of sour soju and tea shots! On the house! It was such a nice gesture and made my birthday even more special. The head chef talked to us a few times, and offered us a free desert! 10/10 service, could not have asked for better\n\nAtmosphere was filled with good Latino and American music, DELICIOUS drinks (try the red sangria) and overall very nice decor.\n\nI would 100% recommend this resturant to anyone wanting to celebrate a special moment, or simply looking for a restaurant that combines good food and good atmosphere.",
