                              "Probably the worst restaurant in HCM even in comparison with some street side restaurants.\n\nThe worst dishes:\n1) Prawn that is butchered with cheese and gimmick of liquid nitrogen\n2) Guava dish that could have been simple and great was again butchered by thick gelatine for no good reason\n3) Scallop also butchered with bad cooking\n4) Eel was overcooked. Such a pity\n5) Most protein except the pork were not well done\n\nGreat stuff:\nThe sweet potato dessert was really good. Texture was amazing with multiple layers of depth\n\nActually felt like puking throughout the meal (and kinda did once). I need a pill and digestive after. I think now that I read comments from the other reviews (that are not marketing from this shop), it‚Äôs true that people felt that this is not fine dining but some guy trying to pull wool over others eyes with some fancy small portions and plates that did not taste anywhere good.\n\nEdit:\nJust looking at the responses from the restaurant and you‚Äôll know they will never improve. If someone says they are bad, it‚Äôs always pointing fingers (as per the other feedbacks as well). Actually we have even feedback DURING the session. So don‚Äôt come back and say ‚ÄúI don‚Äôt know what your intent is‚Äù. I paid full price for a sub par meal so yes, we have the rights to feedback. The worst kind of restaurants are these that just think everyone else is at fault. Taste is subjective but balance and techniques are not. Please wake up your idea.\n\nAlso, please don‚Äôt say you are doing juice pairing when there is no synergies or thoughts behind the pairing. It‚Äôs just selling juice because you can. With your response, I am now VERY sure you‚Äôre the worst restaurant I‚Äôve ever been.",
