                         time: "2024-03-10T12:25:58.000Z",
                         reviewerName: "Ido Simyoni",
                         reviewText:
                              "From the moment I stepped in, the experience was nothing short of brilliant. Every detail, from how they escorted me to my table to the meticulous service throughout each course, was thoughtfully executed. The staff, all fluent in English, ensured I understood every dish, even providing informative cards for each plate. With approximately 18 courses, I opted for juice pairings, a refreshing departure from traditional alcohol pairings. Each dish was a work of art, with standout favorites including the Wagyu steak, the cod, the chorizo and surprisingly, the sourdough bread. Not to mention, the desserts were divine. If I ever find myself back in Saigon, this will undoubtedly be my first stop. I'm already considering a visit to their restaurant in Hanoi. An unforgettable dining experience indeed!",
