                         reviewText:
                              "Visited in Mar 2024\n\nThe meal was an 18 course menu which has been very well thought out in terms of flavour profile, ingredients, presentation style, and quantity. My favourite courses were the Ambarella (starter), the Guava Hamachi (starter), the Chorizo Amaebi (main course), the Laksa Cuttlefish (main course), and the Sweet Potato (dessert). With every course you are also presented with a small card explaining the favour profile of the ingredients and the area of Vietnam it is sourced from. This was a very nice touch to the overall experience as you really get to know the culinary inspiration behind the dish.\n\nFor drinks, I went with the juice pairing which has 5 drinks in total (comprised of kombuchas and ciders). While a couple of kombuchas were nice, overall I found the juice pairing to be average as per my taste. Also the pour sizes are a bit too little to pair one drink with 3 courses.\n\nService was top notch. The restaurant was kind enough to cater to my allergies by replacing a couple of dishes.\n\nAll in all, A By TUNG is one of the best fine dining restaurants I‚Äôve been to in HCM and would 100% recommend it to HCM visitors and residents.",
