                         time: "2024-05-23T08:45:34.000Z",
                         reviewerName: "Duong Maggie",
                         reviewText:
                              "When you dine at the Chef's Table at An's, expect to go through a comprehensive journey of 2-2.5hr long culinary exerpeince.\nOur party booked the private room at An's (8 pax max) , and choose the Dong menu (2.8VNDmil++).\n\nI think the dining experience at An's is very worthwhile to foreigners/ or Vietnamese people who enjoy fusion food. The ingredients are very exquisite, including jellyfish, sand-worm, ant's egg.... but they are tasted so delicious and prepared in a way that is accessible to foreigners. For instance, the sand-worm was made into a mousse structure, somewhat like pate. My favorite is definitely the scallop and the grilled meat dipping in chicken and ants' egg. The tastes of these dishes are mindblowing :D\n\nBut what sets An's apart is not the food, but the atmosphere and the story-telling talent of the chef. I especially enjoy the story behind the dishes at An's, and how the Chef connects the meals together to create a coherent message.\nLooking at the ingredients, and how the chef created the food, I think he has deep gratitude and love for Vietnamese cuisines. He incorporated the specialities across Vietnam : Mountainous North, the Red River and Mekong Delta etc...\n\nThe Chef Table at An's is a very exclusive, but warm and welcoming experience. I enjoyed my time there so much. Thank you chef and the team at An's!\n\nP.s: I also looked at the menu alacarte, which serves guests dining outdoor/ on the patio. The price is very reasonable but of course doesn't include any of the dishes I ate that night. My friends had brunch there and said their Vietnamese-style traditional food were tasty. I think I will comeback oneday to try it out!",
