                         reviewText:
                              "First I want to say that the recommandation of this restaurant is so well made. My friend find this place from the Korean search engine and me from the Michelin guide.\n\nWe had a la carte menu. Staff are so into details, very reliable, courteous and so attentive. They are everything you expected from a top quality staff. Clearly, how they twist the Vietnamese cuisine to bring the traditional Vietnamese cuisine to a modern interpretation is a blast!\n\nI have to give extra credit to the staff. To give context, I have Vietnamese roots and my friends are Korean and German. I have many allergies and one is vegan. Usually in specific place other it‚Äôs all in English or all Vietnamese explanation and I have to translate. I love how they let me speak in Vietnamese and give me explanation in Vietnamese and my friends in English. The level of attention is crazy. To the extend when we ask to have the bill split it was personalized. Experience wise. I love how they accommodate my friends and I.\n\nI am obviously not an expert and I don‚Äôt think I will have the correct vocabulary to describe the foods! I am so happy that I get to enjoy that food. The details the chef put into his creation is so precise. Everything we eat was without any doubt melting. I was so happy being there.\n\nI was so focused on foods that I forgot to take pictures. It‚Äôs how good it was!\nIncredible experience! This place is a must. Thank you guys!",
