                              "This restaurant is incredible. The staff were so attentive the whole night and made sure we were happy. I had the best steak ever here at cloud nine (you get a nice show as well and it gets cooked in front of you)!!! The atmosphere was romantic which was a bonus as we celebrated our anniversary here! Anh le was an incredible host and waiter all night. He was funny, polite and friendly! He asked if we would like any pepper and brought out a massive pepper grinder haha! To anyone who has him as a waiter is lucky! He made sure our anniversary was perfect and it was! The whole experience and food was a 10/10. My partner and I loved this place so much we will be back!!! Please come here for the amazing food, ambiance and staff. You won‚Äôt be disappointed! Also, they have good vegetarian options!",
                         rating: 5,
                         rank: 2,
