                         reviewerName: "Franzi M.",
                         reviewText:
                              "Das Essen ist lecker( ich habe den K√∂chen eine kleine Prise mehr Salz empfohlen, da keine Salzstreuer auf den Tischen stehen). Der Preis f√ºr die kleinen Portionen ist nicht wenig aber f√ºr europ√§ische Verh√§ltnisse absolut in Ordnung.\n\nDer Service ist wie im gesamten Hotel perfekt. Die Angestellten sind professionell, hilfsbereit und herzlich. Sie gehen auch auf individuelle W√ºnsche ein, selbst wenn es nicht auf der Karte steht.\n\nDas Ambiente ist top. Wundersch√∂ner Ausblick auf den Pool und Hochh√§user. Die Einrichtung ist stilvoll. Wie √ºberall in geschlossenen R√§umen in Vietnam immer etwas zu kalt. In kurzen Sachen zu kommen kann ich daher nicht empfehlen.\n\nDennoch f√ºr 5/5 da es rund um ein super Aufenthalt ist.\n\n(Translated by Google)\nThe food is delicious (I recommended a small pinch more salt to the chefs as there are no salt shakers on the tables). The price for the small portions is not low but absolutely okay for European standards.\n\nAs in the entire hotel, the service is perfect. The staff are professional, helpful and warm. They also respond to individual requests, even if it's not on the menu.\n\nThe ambience is great. Beautiful view of the pool and high-rise buildings. The furnishings are stylish. Like everywhere else in closed rooms in Vietnam, it's always a little too cold. I can't recommend coming in short clothes.\n\nStill for 5/5 because it's a great stay.",
